import (
	context "context"
	fern "github.com/mixed-case/fern"
	fernclient "github.com/mixed-case/fern/client"
)

client := fernclient.NewClient()
response, err := client.Service.ListResources(
	context.TODO(),
	&fern.ListResourcesRequest{
		PageLimit: 10,
		BeforeDate: fern.MustParseDate(
			"2023-01-01",
		),
	},
)

